import React from 'react';
import Card from './Card';

const Service = () => {
    return (
        <>
            <div className="container-fluid">
                <div className="row">
                    <div className="col-10 mx-auto">
                        <div className="row gy-3">
                            <Card/>
                            <Card/>
                            <Card/>
                            <Card/>
                            <Card/>
                        </div>

                    </div>

                </div>

            </div>
        </>
    );
}

export default Service;
